            <h3 class=""medium_heading""> II. EDUCATIONAL GOALS </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Program origin </h3>
                <p class=""description""> 
                    Civil engineering represents the techniques of civil constructions. Civil engineers deal with the design, construction, operation and rehabilitation
                    of construction works and infrastructures, which they manage to meet the needs of society, while ensuring public safety and the protection of the
                    environment. Our Bachelor of Science in Civil Engineering - Buildings and Constructions (BSc - CEBC) program was designed to enable the
                    student to become a technician well equipped and who ");
            WriteLiteral(@"knows how to take into account environmental issues in all the projects he would be led to
                    initiate or to be associated.	
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Program objectives </h3>
                <h3 class=""smaller_heading""> II.2.1. General objective </h3>
                <p class=""description""> 
                    The Civil Engineering degree with the mention of Buildings and Constructions (CEBC) aims to acquire basic and applied knowledge in the field
                    of Civil Engineering. It prepares the students for a continuation of studies in Master of Science in Civil Engineering or in Schools of Engineers
                    including in mines and quarries. The first two years are generalist in Sciences for the Engineer, the specialization in Civil Engineering with
                    mention Buildings and Constructions taking place in the 3rd year.
                   ");
            WriteLiteral(@" The first semester is multidisciplinary and common to the Physics, Chemistry and Electronics, Electric Energy and Automation programs, so that
                    the student gradually refines his choice. The Bachelor of Science - CEBC is also part of a common portal B1-B2 (semesters 1 to 4) 
                    between the EEEA and CE references. The cross-curricular and pre-professional skills acquired during the three years of the Bachelor permit students who do
                    not wish to continue their studies to apply for jobs as technicians or assistants in various companies, or to compete in the public sector sphere.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Specific goals </h3>
                <p class=""description""> 
                    <strong> Common run with the mention </strong><br/>
                    This program allows the student to: <br/>
                </p>
                <ul class=""one_list"">

                    <li> 
               ");
            WriteLiteral(@"         Know how to solve simple civil engineering problems by using the concepts of materials resistance, solids mechanics, structural
                        calculations, fluid mechanics, thermal, etc., 
                    </li>

                    <li> 
                        Use the basics of Computer Aided Design (CAD) and those of scientific computing (business software) to model simple structures in 2D
                        and size them under simple solicitations,
                    </li>

                    <li> 
                        Know and know how to use the standards and regulations in force. To make independent use of current experimental techniques in the
                        field of civil engineering, to validate a model by comparing its forecasts to the experimental results and to assess its limits of validity.
                    </li>

                    <li> 
                        Identify the different stages and actors of a construction.
              ");
            WriteLiteral(@"      </li>

                    <li> 
                        Identify the main families of materials and their characteristics. At the end of the course, students will also be able to pursue degree
                        programs at Master’s degree leveB.
